import sys

def main():
    n, m, r = map(int, sys.stdin.readline().split())
    buy = list(map(int, sys.stdin.readline().split()))
    sell = list(map(int, sys.stdin.readline().split()))
    buy.sort(reverse=True)
    sell.sort(reverse=True)
    ans = r
    for i in range(m):
        if ans >= sell[i]:
            ans -= sell[i]
        else:
            break
    for i in range(n):
        if ans >= buy[i]:
            ans += buy[i]
        else:
            break
    print(ans)

